import React from 'react';
import ReactDOM from 'react-dom';
import SeasonDisplay from './SeasonDisplay'

const App = () => {
    return (
        <div className={"season ui"}>
            {new SeasonDisplay()}
            Hi There!
        </div>
    )
}

ReactDOM.render(<SeasonDisplay />, document.querySelector('#root'))
